import { Tab, Tabs} from "@material-ui/core";
import React from "react";
import MailIcon from '@material-ui/icons/Mail';

const Header=()=>{
    return(
        <Tabs value='0' aria-label="icon label tabs example">
        <Tab icon={<MailIcon />} label="RECENTS" value='0' />
        <Tab icon={<MailIcon />} label="FAVORITES" />
        <Tab icon={<MailIcon />} label="NEARBY" />
      </Tabs>
    )
};

export default Header;
